import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{r,o as l,c as n,b as e,d as o,a as i,f as c}from"./app-06f50d85.js";const s={},d=e("h2",{id:"git",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#git","aria-hidden":"true"},"#"),o(" git")],-1),p=e("blockquote",null,[e("p",null,"Gitee、GitHub、GitLab、Gitcode")],-1),h={href:"https://www.bilibili.com/video/BV1fN4y1r7ie",target:"_blank",rel:"noopener noreferrer"},b={href:"https://www.bilibili.com/video/BV14V4y1U7k9/",target:"_blank",rel:"noopener noreferrer"},u={href:"https://www.bilibili.com/video/BV1Ga4y1G79o",target:"_blank",rel:"noopener noreferrer"},m=c('<blockquote><p>注：有git前置知识（会基础的命令），再看这视频会有更好的理解和感受。也可以直接看这个视频，但就没有那种恍然大悟，也不好理解git。</p></blockquote><h2 id="编译器" tabindex="-1"><a class="header-anchor" href="#编译器" aria-hidden="true">#</a> 编译器：</h2><blockquote><p>idea、eclipse、Android studio、vscode、Hbuilder、</p></blockquote><p>需要会将将项目拉取下，配置好环境，并能运行起来。</p><p>像老项目很多使用的eclipse开发的，想eclipse项目导入到idea中也需要会配置环境，可能有的项目你在idea中配置好了jdk版本、tomcat、lib（依赖），但项目中还是会飘红、跑不起来，这时你就很迷茫了。不着急，这可能就是提交不规范或有的人提交上去有稍微的问题，但是并不影响本地的项目运行。但对于新拉取的人来说就烦心了，各种问题，特别是eclipse比较老的项目。原因有很多比如我们使用的都是比较新的编译器、可能就会编码问题。解决办法有很多，比如：有的代码根据提示注释即可，并不影响代码运行，特别是一些测试代码，编码问题就需要配置好编译器的编码，但这并不能解决所有问题，当你解决一个问题，又有新的问题。</p><p>idea编译器导入eclipse项目还是不行，就换eclipse项目，可能你还会遇到问题，第一步就阻挡了你的去路，这时你会感到崩溃，emo。你从尝试idea，再到尝试eclipse，折腾来会也没有跑起来。有时并不是自己的原因，得换下思路了。从仓库中拉下来得项目，是多人协作提交的。可能有的人并没有将自己新增加的依赖提交上去，但他们会他们会跟你说需要新增加哪几个依赖。但换了一个人就是另一种说法了。接手新项目的时候，可能配环境都到emo了，会劝退一些人，懂的都懂。</p><h2 id="数据库" tabindex="-1"><a class="header-anchor" href="#数据库" aria-hidden="true">#</a> 数据库</h2><blockquote><p>Mysql、Oracle</p></blockquote><p>对于Mysql连接工具会一两种即可（Navicat Premium 16、SQLyog、idea自带的）<br> Oracle通常使用 Pl/SQL 连接工具，不过Navicat也能使用，通过使用比较多的还是PL/SQL。PL/SQL可以同时连接6个数据库，感觉不够使用。</p><p>Mysql是入门必会的，额，sql server 那就算了，目前使用到的比较少。</p><p>Oracle 学习起来还是有一定的成本的，特别是SQL又丑又长，~~</p><h2 id="linux工具" tabindex="-1"><a class="header-anchor" href="#linux工具" aria-hidden="true">#</a> linux工具</h2><blockquote><p>XShell、Xftp、FinalShell 、Termius、MobaXterm</p></blockquote><p>前置Linux基本命令、对Linux有一定了解，一般使用比较多的服务器是centos7</p><p>一般在公司会连接多个服务器，为了方便切换服务器有企业版（ Xmanager ）</p><p>个人使用推荐：FinalShell、MobaXterm</p><h2 id="测试工具" tabindex="-1"><a class="header-anchor" href="#测试工具" aria-hidden="true">#</a> 测试工具</h2><blockquote><p>postman、swagger、ApiPost、swagger API</p></blockquote><p>对于springboot框架很多都引入了swagger，你可以将接口API导入到postman中，一般线上测试都需要加入对应的cookie，并不能像你平时那样直接可以测试的。</p><h2 id="其他工具" tabindex="-1"><a class="header-anchor" href="#其他工具" aria-hidden="true">#</a> 其他工具</h2><p>设计工具： 墨刀</p><p>思维导图：XMind、ProcessOn</p><p>禅道、IPS</p><h2 id="笔记工具" tabindex="-1"><a class="header-anchor" href="#笔记工具" aria-hidden="true">#</a> 笔记工具</h2><blockquote><p>typroa（markdown编译器）、obsidian</p></blockquote><p>公司内网使用的话，记录一些用户名、密码、地址，就需要一款数据库笔记工具 -- mybase （可设置密码）</p>',26);function _(f,k){const a=r("ExternalLinkIcon");return l(),n("div",null,[d,p,e("p",null,[o("教程："),e("a",h,[o("https://www.bilibili.com/video/BV1fN4y1r7ie"),i(a)])]),e("p",null,[e("a",b,[o("https://www.bilibili.com/video/BV14V4y1U7k9/"),i(a)])]),e("p",null,[e("a",u,[o("https://www.bilibili.com/video/BV1Ga4y1G79o"),i(a)])]),m])}const g=t(s,[["render",_],["__file","front-dev-tool.html.vue"]]);export{g as default};
